export const getBntwData = () => {


    return(dispatch) =>{
        dispatch({type: 'LOADING_BNTW_DATA'})  

        fetch(`https://graph.microsoft.com/v1.0/me/drive/items/2AFCEB71CDCBE53D!1166/workbook/worksheets('BNTWData')/usedRange`).then(response => response.json())
        .then(rxData => {
            debugger
            rxData.error ? alert(rxData.error.message) : dispatch({type: 'RETURNED_PROJECTS_DATA', sheetData: rxData.values})
        })
    }
}
